        }
    }

    return (
      <>
        <Button
          onClick={() => setOpen(!open)}
          aria-controls="example-collapse-text"
          // aria-expanded={open}
          variant='secondary'
        >
          Add to Inventory
        </Button>
        <Collapse in={open}>
          <div styel={styleMedia.divSpot}>
           <InventoryInsert inventoryAjaxPost={props.invAJAXPost}/>
           </div>
        </Collapse>
      </>
  );
}

